def get_polygons(latitude_step, longitude_step):
    latitude_step_rounded = round(latitude_step, 6)
    longitude_step_rounded = round(longitude_step, 6)

    latitude_num = math.floor((latitude_max-latitude_min)/latitude_step_rounded)+1
    longitude_num = math.floor((longitude_max-longitude_min)/longitude_step_rounded)+1

    polygons = []
    for i in range(latitude_num):
        latitude_up = latitude_min + latitude_step * (i + 1)
        polygons.append([[latitude_up, longitude_max], [latitude_up, longitude_min]])
    for j in range(longitude_num):
        longitude_left = longitude_max - longitude_step * (j + 1)
        polygons.append([[latitude_min, longitude_left], [latitude_max, longitude_left]])
    return polygons

